import React from "react";
import "./contact.css";
function Contact() {
  return (
    <>
      <div className="heading">Contact</div>
      <div className="contantdetail">
        <h4>
          Want to discuss something or just want to say hi? My inbox is open for
          all
        </h4>
      </div>
      <div className="socialimg">
        <a href="https://github.com/saumyaparikh">
          <i className="img fab fa-github fa-2x"></i>
        </a>
        <a href="https://www.linkedin.com/in/saumyaparikh/">
          <i className="img fab fa-linkedin-in fa-2x"></i>
        </a>
      </div>
    </>
  );
}

export default Contact;
